import logo from './images/domain.svg';
import main from './images/main.jpeg';

const Header = () => {
return (
  <header className="header">
     <img src={logo}  height="50" />
     <img id="mainphoto" src={main} width="100%"/>
     WWSI social..
</header>
);
}

export default Header;
